    false,nt"url": null,nt"notes": "This spreadsheet indicates the content
    requested for AASG geothermal data compiled from logs acquired in boreholes. The
    compiled data will be used to produce metadata records describing logs as resources
    of interest. Typcially bottomhole temperatures are recorded from log headers, and
    this information will be provided through a borehole temperature observation service.
    The HeaderURI for a particular borehole (well for simple wells) is the cross-referencing
    link (foreign key) used to associate the header record, well logs, temperature measurements,
    and other information from a particular borehole.",nt"license_title": null,nt"extras":
